import React from "react";
import "./index.css";
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from "./routes/Home";
import Club from "./routes/Club";



function App() {
  return (

    <Router>

    <div className="App">
       <Routes>
       <Route path='/' element = {<Home />} />
       <Route path='/club' element = {<Club />} />



       </Routes>

    </div>
    </Router>
  );
}

export default App;
